  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0130815 includes physical
  and profile data collected aboard NOAA Ship THOMAS JEFFERSON during project OPR-K371-TJ-10
  in the Gulf of Mexico from 2010-04-15 to 2010-05-12. These data include SOUND VELOCITY.
